import './App.css';
import React from 'react';
import { Button } from '@material-ui/core';
import countapi from 'countapi-js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button 
          color="primary" 
          variant="outlined"
          onClick={() => {
            countapi.visits().then(result => console.log(result.value));
          }}
        >
          Hello world
        </Button>
      </header>
    </div>
  );
}

export default App;
